import React from 'react';
import { Container } from '@material-ui/core';

const Quiz = () => {
  return (
    <>
      <div className="background">
        <Container>ALO ALO</Container>
      </div>
      <style jsx>
        {`
          * {
            margin: 0;
            padding: 0;
          }
          ,
          .background {
            width: 100vw;
            min-height: 100vh;
            background-color: #3498db;
            display: flex;
            justify-content: center;
            align-items: center;
          }
        `}
      </style>
    </>
  );
};

export default Quiz;
